description:
An improved API on top of System.Diagnostics. 
Adds support for dynamic runtime configuration of trace sources, hierarchical trace sources and testability.
    
Usage: static readonly ITracer tracer = Tracer.Get<MyClass>();

win 服务集成组件
具有以下特性：
1、安装时可以读取配置文件服务名称及注释
2、集成了安装服务API
3、实现简单集成服务
如：
/// <summary>
/// 应用程序的主入口点。
/// </summary>
public static void Main(string[] args)
{
    using (ServiceBaseUtility setting = new ServiceBaseUtility())
    {
        if (!string.IsNullOrWhiteSpace(setting.ServiceName))
        {
            //系统用于标志此服务名称(唯一性)
            ServiceBaseController.State<Service1>(setting.ServiceName, args);
        }
    }
}
